import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import BasicSelect from '../../components/IdeaComponents/Select';
import { makeStyles } from "@material-ui/core";

const useStyles = makeStyles(() => ({
    Form: {
        flex: 1,
    },
}));

const AddIdea = () => {
    const classes = useStyles();

    return (
        <Box component = 'form' className={classes.Form}>
            <div>
                <TextField id="ideaName" label="Name of Idea" variant="standard" />
            </div>
            <div>
                <TextField id="ideaDescription" label="Description" variant="standard" />
            </div>
            <div>
                <BasicSelect />
            </div>
            <div>
            <Button
                variant="contained"
                style={{
                width: 85,
                height: 40,
                marginLeft: 15,
                backgroundColor: "#EEBC1D",
                }}
                onClick={handleOpen}
            >
                Add Idea
            </Button>
            </div>
        </Box>
    )
}

export default AddIdea
